import{useEffect, useState} from "react";


function App() {
  const [status, setStatus] = useState(0);
  const [data, setData] = ([]);

  const API_URL = "https://my.api.mockaroo.com/orders.json?key=e49e6840";

  useEffect(() => {

    fetch(API_URL)
    .then((response) => response.json())
    .then((json) => {
       setData(json);
       console.log(json);

       setStatus(2);
    })
    .catch(() => setStatus(1));
  }, [setData, setStatus]);

  return( 
  <div className="App">

   {status===0 && <p>Loading⏳</p>}
   {status===0 && <p>Error❗️</p>}
   {status===0 && <p>Data Loaded🎉</p>}

  </div>
  );
}

export default App;
